local E=1.70e+07
local nu=0.22
local Bulk = E/(3*(1-2*nu))
local porosity = 0.25
local biot = 0.75
local BulkG = Bulk/(1.00001- biot)
local cb =  porosity/2.2E6 + (biot-porosity)/BulkG
local s_day = 1/86400
--local cb =  7.11e-8
NodeFunction { id = 'pore_f',
             parameters = { {src = 'time', unit = 's'} },
             method = function(t)
		       local DP = -9000
			   local P0 =  44000
			   local tf = 365*86400*s_day
               local pore = P0 + DP*t/tf	
			   return pore
             end
           }	  



